def get_divider_event(string=None, slash=15):
    return [{
        "Type": "Comment",
        "Layer": 1,
        "Start": "00:00:00.00",
        "End": "00:00:00.00",
        "Style": "screen", "Name": '',
        "MarginL": 0, "MarginR": 0, "MarginV": 0,
        "Effect": '',
        "Text": "-" * slash + f"{(' ' + string + ' ') if string else ''}" + "-" * slash
    }]


def get_asset_path(filename=""):
    if getattr(sys, 'frozen', False):
        asset_path = os.path.join(sys._MEIPASS, "asset")
    else:
        asset_path = "asset"
    return os.path.join(asset_path, filename)


